import React from 'react';

function Doc(props) {

  useEffect(() => {
    console.log(props)
  });

  return (
    <div className="docs_col">
      <p>{props.name}</p>
      <img src={props.source ? "": URL.createObjectURL(props.source)} className="image" id={props.source.name} alt="image not found"/>
    </div>
  );
};

export default Doc;
